      <text id="9" justification="0" size="4" underlined="false">
        <text>Se desea llevar a cabo una aplicación capaz de gestionar libros, lo que
supone poder adquirir nuevos libros y modificar el precio de los libros a la
venta.
Para cada libro se dispone del título, el autor, la fecha de publicación, la
editorial y el precio. Además, la tienda desea ofrecer a sus compradores
información sobre los autores de los libros, incluyendo, además de su nombre
completo, su página web y su correo electrónico.
La tienda trabaja directamente con las distintas editoriales, por lo que
necesita también disponer de la dirección, el teléfono y la persona de contacto
de cada editorial, teniendo en cuenta que estos datos pueden cambiar.
</text>
